import React from "react";
import ReactDOM from "react-dom";
import Card from './Cards';
import './index.css';
import Sdata from './Sdata';

ReactDOM.render(
  <>

    <h1 className="heading_style"> List of Top 5 Netflix Series in 2020 </h1>

    <Card imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />
    <Card imgsrc="https://www.inspirationde.com/media/2020/07/dark-season-concept-keyart-on-behance-15946476138nk4g.png" 
      title=" A Netflix Orignal Series "
      sname={Sdata[1].sname}
      link="https://www.netflix.com/in/title/80100172"
    />
    <Card imgsrc="https://www.inspirationde.com/media/2020/07/dark-season-concept-keyart-on-behance-15946476138nk4g.png" 
      title=" A Netflix Orignal Series "
      sname={Sdata[2].sname}
      link="https://www.netflix.com/in/title/80100172"
    />
    <Card imgsrc="https://www.inspirationde.com/media/2020/07/dark-season-concept-keyart-on-behance-15946476138nk4g.png" 
      title=" A Netflix Orignal Series "
      sname={Sdata[3].sname}
      link="https://www.netflix.com/in/title/80100172"
    />
    <Card imgsrc="https://www.inspirationde.com/media/2020/07/dark-season-concept-keyart-on-behance-15946476138nk4g.png" 
      title=" A Netflix Orignal Series "
      sname={Sdata[4].sname}
      link="https://www.netflix.com/in/title/80100172"
    />
  </>,

  document.getElementById('root')
);
